import React from "react";

const Header = () => {
  return (
    <div>
      <h1>Full Stack Developer</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>Projects</li>
          <li>About Me</li>
          <li>Contact</li>
        </ul>
      </nav>
    </div>
  );
};

export default Header;
